column2:
There are several acts by the name of Disturbed;

1) Disturbed is an American hard rock band from Chicago, Illinois, formed in 1994. The band includes vocalist David Draiman, bassist John Moyer, guitarist/keyboardist Dan Donegan, and drummer Mike Wengren. Former band members are vocalist Erich Awalt and bassist Steve Kmak.

The band has released six studio albums, five of which have consecutively debuted at number one on the Billboard 200. Disturbed went into hiatus in October 2011 <a href="https://www.last.fm/music/Disturbed">Read more on Last.fm</a>

There are several artists named Tom Walker;

1. Tom Walker is an Scottish born, Manchester raised, multi-instrumentalist and vocalist signed to Sony’s Relentless Records. During 2016, he released the songs "Sun Goes Down", "Fly Away With Me", "Play dead" and "Just You And I (Acoustic)".

2. Tom Walker is a heavy metal guitarist, bassist and vocalist from Milton Keynes, UK. He self-released a single named 'Downhill Flight' in January 2008, including a B-side named 'Love is a Killing Thing'. <a href="https://www.last.fm/music/Tom+Walker">Read more on Last.fm</a>

There are several artists named 'Champs' ;

1)  Champs are Michael and David Champion, two brothers from the Isle of Wight's Victorian seaside retreat of Ventnor. 

Their debut album, Down Like Gold, was recorded at Studio Humbug, an old water tower inside the walls of Osborne House, Queen Victoria's retreat on the north of island. Designed by Prince Albert in 1845, the building has a large top floor that now houses a studio and above it all sits <a href="https://www.last.fm/music/Champs">Read more on Last.fm</a>

There are several artists named Idlewild;

1) Idlewild is a rock band which formed in Edinburgh, Scotland in 1995. The band currently comprises of Roddy Woomble (lead vocals), Rod Jones (guitar, backing vocals), Colin Newton (drums), Andrew Mitchell (bass/guitar) and Luciano Rossi (keyboard). They are joined on tour at present by Hannah Fisher (fiddle).

The band has released "Hope is Important" (1998), "100 Broken Windows" (2000), "The Remote Part" (2002) <a href="https://www.last.fm/music/Idlewild">Read more on Last.fm</a>

LOVE X STEREO is an electronic rock band based in Seoul, Korea. LOVE X STEREO’s music is authentic electronic music based in alternative and punk rock from the 90s. With its free use of synthesizing and effects, LOVE X STEREO’s music is danceable.

// BIO //

Launched in 2011 by former skate punk rocker Toby Hwang and fugitive astrophysicist Annie Ko, Love X Stereo is a dazzling Seoul electro rock duo whose dreamy kaleidoscope of stellar synthpop anthems have enraptured music festival audiences across Asia and North America. <a href="https://www.last.fm/music/Love+X+Stereo">Read more on Last.fm</a>

There are two artists currently using this name.

1) Keto is a lo-fi folk artist from Nottingham, UK whose style has been likened to Cat Power and Elliott Smith. 

https://ketomusic.bandcamp.com/

2) Keto is Ukrainian post-hardcore band from Lutsk.
Now Keto is:
Stariy - guitar\vocals;
Anj - bass\vocals;
Lotr - keyboards;

www.ketoband.com <a href="https://www.last.fm/music/KEtO">Read more on Last.fm</a>
